const SlideShow = () => {
  return (
    <div className="fit h-4/5 max-h-[900px] w-3/4 max-w-[1600px] rounded-md bg-neutral-500">
      <img src="/images/slide-key.png" alt="SlideImage" className="h-[95%] w-full" />
      <div className="h-3 w-28 bg-fuchsia-300"></div>
    </div>
  );
};

export default SlideShow;
